import JsBridge from '@knb/native-bridge';
import { getShareBaseUrl } from '@kucoin-biz/share';
import { useCallback, useMemo } from 'react';
import { shallowEqual } from 'react-redux';
import { useSnackbar } from '@kux/mui';
import { copyToClipboard } from '@kc/mk-design';
import { tenantConfig } from 'src/config/tenant';
import { useSelector } from 'src/hooks/useSelector';
import { IS_PROD_ENV } from 'src/utils/env';
import { _t, addLangToPath } from 'tools/i18n';


export default (url) => {
  const isInApp = JsBridge.isApp();
  const { message } = useSnackbar();
  const referralCode = useSelector((state) => state.user.referralCode, shallowEqual);

  const shareLink = useMemo(() => {
    const shareHost = getShareBaseUrl({ isUseProHost: IS_PROD_ENV });
    return addLangToPath(`${shareHost}${url}${referralCode ? `?rcode=${referralCode}` : ''}`);
  }, [referralCode, url]);

  const handleShare = useCallback(() => {
    if (!isInApp) return;
    if (tenantConfig.showShareDialog) {
      // app 内分享
      JsBridge.open({
        type: 'func',
        params: {
          name: 'share',
          category: 'img',
          needQrCode: true,
          rcode: referralCode, // 可选,ios旧版本有问题，建议加上
          qrCodeUrl: shareLink, // 可选,默认分享注册链接
          link: shareLink, // 可选,默认分享注册链接
          pic: 'data:image/jpeg;base64,',
        },
      }, (data) => {
        console.log('app share success', data);
      });
    } else {
      copyToClipboard(shareLink);
      message.success(_t('afb1ecf83b964000a45c'));
    }
  }, [isInApp, referralCode, shareLink, message]);

  return handleShare;
};
